import "./styles.css";
import { useState } from "react";

const anonymizePhone = (phone) => {
  const digits = phone.replace(/\D/g, "");
  if (digits.length !== 8) return phone;
  return digits.slice(0, 4) + " XXXX";
};

const parseDescription = (text, onPhoneClick) => {
  if (!text) return null;
  
  const phoneRegex = /\b(\d{8})\b/g;
  const lines = text.split("\n");
  
  return lines.map((line, lineIdx) => {
    const parts = [];
    let lastIdx = 0;
    
    line.replace(phoneRegex, (match, phone, offset) => {
      if (offset > lastIdx) {
        parts.push(line.substring(lastIdx, offset));
      }
      parts.push(
        <span
          key={`phone-${lineIdx}-${offset}`}
          className="phoneNumber"
          onClick={() => onPhoneClick(phone)}
          title="Click to reveal"
        >
          {anonymizePhone(phone)}
        </span>
      );
      lastIdx = offset + match.length;
    });
    
    if (lastIdx < line.length) {
      parts.push(line.substring(lastIdx));
    }
    
    return (
      <p key={lineIdx} className="descriptionLine">
        {parts.length > 0 ? parts : line}
      </p>
    );
  });
};

export default function ListingAd({flag, arrow_left, arrow_right, price, icon, pic, title, address, description, availabilities_label, subprice_label, project_type, year, ownership_type }) {
  const [showDescription, setShowDescription] = useState(false);
  const [revealedPhones, setRevealedPhones] = useState({});

  const handlePhoneClick = (phone) => {
    setRevealedPhones(prev => ({ ...prev, [phone]: true }));
  };

  return (
    <div className={`App ${showDescription ? "expanded" : ""}`}>
      <div className="imageContainer">
        {flag && <img className="flag" src={flag} alt="Flag" />}
        <img className="mainPic" src={pic} alt={title} />
        
        <button className="arrowBtn arrowLeft">
          <img src={arrow_left} alt="Previous" />
        </button>
        <button className="arrowBtn arrowRight">
          <img src={arrow_right} alt="Next" />
        </button>
      </div>
      <div className="mainContent">
        <div className="topContent">
            <div className="leftContent">
              <div className="leftTopContent">
                <img className="icon" width="40" height="40" src={icon}/>
                  <div className="textLeftTopContent">
                    <h1 className="title">{title}</h1>
                    <p className="address">{address}</p>
                  </div>
              </div>
              <div className="leftBotContent">
                <p className="labelTop">{project_type} · {year} · {ownership_type}</p>
                <p className="labelBot">{availabilities_label}</p>
              </div>
            </div>

            <div className="rightContent">
              <div className="price">
                <h1>{price}</h1>
              </div>
              <p className="priceFrom">{subprice_label}</p>
            </div>
        </div>

        <div className="bottomContent">
          <button onClick={() => setShowDescription(!showDescription)}>
            {showDescription ? "Hide description" : "See description"}
          </button>
        </div>

        {showDescription && (
          <div className="descriptionContainer">
            {parseDescription(description, handlePhoneClick).map((line, idx) => {
              const phone = Object.keys(revealedPhones).find(p => line.key === `phone-line-${idx}`);
              return (
                <div key={idx}>
                  {line.props.children.map((part, pidx) => 
                    typeof part === 'string' ? part : 
                    revealedPhones[part.props.children.replace(/\s/g, '')] ? 
                    part.props.onClick().toString() : part
                  )}
                </div>
              );
            })}
            {description && parseDescription(description, handlePhoneClick)}
          </div>
        )}

      </div>
    </div>
  );
}
